import MuzicaClasicaBody from "./MuzicaClasicaBody";

const MuzicaClasica = () => {
  return (
    <>
      <h1 class="row d-flex justify-content-center mt-5 mb-5">
        Muzica Clasica
      </h1>
      <div>
        <MuzicaClasicaBody></MuzicaClasicaBody>
      </div>
    </>
  );
};

export default MuzicaClasica;
